import { createContext } from 'react';

const DataLayerContext = createContext({
  user: null,
});

export const DataLayer = (props) => {
  const context = {};

  return (
    <DataLayerContext.Provider value={context}>
      {props.children}
    </DataLayerContext.Provider>
  );
};

export default DataLayerContext;
